import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';
import {Router, Route, IndexRoute, hashHistory,browserHistory} from 'react-router';
import { Provider } from 'react-redux';
import { createStore, applyMiddleware } from 'redux';
import thunk from 'redux-thunk';
import reducers from './reducers';
import { I18n ,I18nextProvider} from 'react-i18next';
import i18n from './translation';
import { syncHistoryWithStore } from "react-router-redux";
import configureStore from "./store/configureStore";

import * as actions from './actions/index';

ReactDOM.render(<App />, document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: http://bit.ly/CRA-PWA
serviceWorker.unregister();




const store = configureStore();

// Create an enhanced history that syncs navigation events with the store
const history = syncHistoryWithStore(browserHistory, store);






function Authentication(nextState, replace) {
    const isAuthenticated = true;
     // isAuthenticated = localStorage.getItem("authData") ? true : false;
      if (!isAuthenticated) {
        replace({
          pathname: "/",
          state: { nextPathname: nextState.location.pathname }
        });
      }
}

ReactDOM.render(
  <I18nextProvider i18n={i18n}>
    <Provider store={store}>
      <Router history={hashHistory}>
          <Route path="/" >
              <IndexRoute component={LoginPage} />
              <Route path="login" component={LoginPage} />
              <Route path="create-password" component={CreatePassword} />
              <Route path="/request-password-captcha" component={PasswordRequest} />
              <Route path="/request-password" component={RequestPassword} />
              <Route path="/logout" component={Logout} />
              <Route path="app"  component={Layout} onEnter={Authentication}>
                  <Route path="start" component={HomePage} />
                  <Route path="planning" component={MisPlanillas} />
                  <Route path="payroll-applicable-details" component={PayrollDetailsApplicable} />
                  <Route path="payroll-pending-details" component={PayrollDetailsPending} />
                  <Route  path="declare-payroll-reason" component={DeclareReasonPyment} />  
                  <Route path="payroll-details" component={PayrollDetails} />
                  <Route  path="visto-buena"  component={VistoBuena} />
                  <Route  path="financial-information"  component={FinancialInformation} />
                  <Route  path="benefits-alliances"  component={BenefitsAlliances} />
                  <Route  path="search-partner"  component={SearchPartner} />
                  <Route  path="visto-buena-123"  component={VistoBuenaDescription} />
                  <Route  path="visto-buena-confirm"  component={VistoBuenaConfirm} />
                  <Route  path="profile-administrator" component={ProfileAdministration} />
                  <Route  path="edit-profile" component={ProfileAdministration} />
                  <Route path="contact" component={Contact} />
                  <Route path="ui-elements" component={UiElements} />
                  <Route path="default-app" component={App}/>
              </Route>
          </Route>
      </Router>
   </Provider>
 </I18nextProvider>
    , document.getElementById('app'));
